(303, '_transient_tribe-app-shop-products', 'O:8:"stdClass":4:{s:5:"error";b:0;s:5:"count";i:8;s:6:"banner";O:8:"stdClass":2:{s:14:"top_banner_url";s:73:"https://theeventscalendar.com/content/uploads/2014/12/banner_ecp_shop.jpg";s:15:"top_banner_link";s:94:"https://theeventscalendar.com/?utm_campaign=in-app&utm_source=addonspage&utm_medium=top-banner";}s:4:"data";a:8:{i:0;O:8:"stdClass":7:{s:5:"title";s:10:"Filter Bar";s:9:"permalink";s:145:"https://theeventscalendar.com/product/wordpress-events-filterbar/?utm_campaign=in-app&utm_source=addonspage&utm_medium=wordpress-events-filterbar";s:18:"featured_image_url";s:94:"https://theeventscalendar.com/content/uploads/2014/03/Screen-Shot-2014-03-27-at-1.05.33-PM.png";s:11:"description";s:421:"<p>It is awesome that your calendar is<em>THE PLACE</em>to get hooked up with prime choice ways to spend time. You have more events than Jabba the Hutt has rolls.Too bad visitors are hiring a personal assistant to go through all the choices. Ever wish you could just filter the calendar to only show events in walking distance, on a weekend, that are free? BOOM. Now you can. Introducing&#8230;theFilter Bar.</p>\n";s:8:"category";s:7:"Premium";s:11:"last_update";N;s:7:"version";N;}i:1;O:8:"stdClass":7:{s:5:"title";s:16:"Community Events";s:9:"permalink";s:145:"https://theeventscalendar.com/product/wordpress-community-events/?utm_campaign=in-app&utm_source=addonspage&utm_medium=wordpress-community-events";s:18:"featured_image_url";s:72:"https://theeventscalendar.com/content/uploads/2013/06/addon-communty.jpg";s:11:"description";s:384:"<p>Enable users to submit events to your calendar with Community Events. You can require user accounts or allow visitors to submit without an account. Want to make sure that nothing fishy is going on? Just turn on moderation. Decide if users can edit and manage their own events, or simply submit. Plus, no scary form setup! Just activate, configure the options &amp; off you go.</p>\n";s:8:"category";s:7:"Premium";s:11:"last_update";N;s:7:"version";N;}i:2;O:8:"stdClass":7:{s:5:"title";s:18:"Eventbrite Tickets";s:9:"permalink";s:149:"https://theeventscalendar.com/product/wordpress-eventbrite-tickets/?utm_campaign=in-app&utm_source=addonspage&utm_medium=wordpress-eventbrite-tickets";s:18:"featured_image_url";s:75:"https://theeventscalendar.com/content/uploads/2013/06/addon-eventbriete.jpg";s:11:"description";s:441:"<p>The Eventbrite Tickets add-on allows you to create &amp; sell tickets through The Events Calendar using the power of <a href="http://www.eventbrite.com/r/etp">Eventbrite</a>. Whether you&#8217;re creating your ticket on the WordPress dashboard or importing the details of an already-existing event from <a href="http://www.eventbrite.com/r/etp">Eventbrite.com</a>, this add-on brings the power of the Eventbrite API to your calendar.</p>\n";s:8:"category";s:7:"Premium";s:11:"last_update";N;s:7:"version";N;}i:3;O:8:"stdClass":7:{s:5:"title";s:19:"Events Calendar Pro";s:9:"permalink";s:151:"https://theeventscalendar.com/product/wordpress-events-calendar-pro/?utm_campaign=in-app&utm_source=addonspage&utm_medium=wordpress-events-calendar-pro";s:18:"featured_image_url";s:67:"https://theeventscalendar.com/content/uploads/2013/06/addon-pro.jpg";s:11:"description";s:372:"<p>The Events Calendar PRO is a paid Add-On to our open source WordPress plugin <a href="https://theeventscalendar.com/product/wordpress-events-calendar/">The Events Calendar</a>. PRO offers a whole host of event management features including recurring events, custom event attributes, saved venues &amp; organizers, venue pages, advanced event admin &amp; lots more.</p>\n";s:8:"category";s:7:"Premium";s:11:"last_update";N;s:7:"version";N;}i:4;O:8:"stdClass":7:{s:5:"title";s:15:"Facebook Events";s:9:"permalink";s:123:"https://theeventscalendar.com/product/facebook-events/?utm_campaign=in-app&utm_source=addonspage&utm_medium=facebook-events";s:18:"featured_image_url";s:72:"https://theeventscalendar.com/content/uploads/2013/06/addon-facebook.jpg";s:11:"description";s:366:"<p>With the Facebook Events add-on, imported events are manually or automagically created as entries in The Events Calendar. Basic event data along with venue &amp; organizer are populated appropriately. No more entering information in two places, or having to recreate someone elses listing for a public event you want to include on your WordPress calendar.</p>\n";s:8:"category";s:7:"Premium";s:11:"last_update";N;s:7:"version";N;}i:5;O:8:"stdClass":7:{s:5:"title";s:17:"Community Tickets";s:9:"permalink";s:127:"https://theeventscalendar.com/product/community-tickets/?utm_campaign=in-app&utm_source=addonspage&utm_medium=community-tickets";s:18:"featured_image_url";s:89:"https://theeventscalendar.com/content/uploads/2015/10/ecp-community-tickets-app-store.jpg";s:11:"description";s:350:"<p>Enable Community Events organizers to offer tickets to their events. You can set flexible payment and fee options. They can even check-in attendees to their events! All of this managed from the front-end of your site without ever needing to grant access to your admin.</p>\n<p><strong>Requires:</strong> Event Tickets Plus and Community Events</p>\n";s:8:"category";s:7:"Premium";s:11:"last_update";N;s:7:"version";N;}i:6;O:8:"stdClass":7:{s:5:"title";s:18:"Event Tickets Plus";s:9:"permalink";s:149:"https://theeventscalendar.com/product/wordpress-event-tickets-plus/?utm_campaign=in-app&utm_source=addonspage&utm_medium=wordpress-event-tickets-plus";s:18:"featured_image_url";s:79:"https://theeventscalendar.com/content/uploads/2015/12/app-store-tickets-pro.jpg";s:11:"description";s:273:"<p>Event Tickets Plus allows you to sell tickets to your events using WooCommerce, Shopp, WP eCommerce, or Easy Digital Downloads. Use it on your posts and pages, or add <a href="http://m.tri.be/18vc">The Events Calendar</a> and sell tickets from your events listings.</p>\n";s:8:"category";s:7:"Premium";s:11:"last_update";N;s:7:"version";N;}i:7;O:8:"stdClass":7:{s:5:"title";s:13:"iCal Importer";s:9:"permalink";s:119:"https://theeventscalendar.com/product/ical-importer/?utm_campaign=in-app&utm_source=addonspage&utm_medium=ical-importer";s:18:"featured_image_url";s:69:"https://theeventscalendar.com/content/uploads/2015/07/addon-ical1.jpg";s:11:"description";s:469:"<p>The iCal Importer helps you keep your events calendar full of interesting events! You can import events from any website that publishes an iCal (aka ICS) feed and add them to your listings. The recurring import feature lets you keep your calendar brimming without manual oversight (though you can review every imported event if you like). Add filtering by keyword or geographic region and you can be sure that the kinds of events you get are the kinds you want.</p>\n";s:8:"category";s:7:"Premium";s:11:"last_update";N;s:7:"version";N;}}}', 'no'),
